(10008, 'I was married for 13 years officially (we were going out for six before that), but the final two years were really hard to get through. I was physically ill and getting worse with no cure in prospect. \r\n \r\nMy ex-wife couldn’t handle it and want', 'I was married for 13 years officially (we were going out for six before that), but the final two years were really hard to get through. I was physically ill and getting worse with no cure in prospect. \r\n \r\nMy ex-wife couldn’t handle it and wanted me out of the home we had built. Counselling didn’t work. \r\n \r\nI didn’t want it to end but I relented and eventually I remortaged the house and bought out her share in it. She moved out with our two wonderful kids in 2010. \r\n \r\nI see them twice a week and sometimes a lot more through activities. I am totally involved in their lives, but five years later I can’t move on. I meet my ex-wife so much and still can’t get over the rejection. My thoughts always go back to “in sickness and in health” and “till death us do part”. \r\n \r\nMy health is stable even though I’m now severely incapacitated, but I’ve become a stronger person. \r\nI still love my ex-wife and want our family back, but last week I received the divorce papers. \r\n \r\nThe writer’s name has been changed.\r\nShare your story at irishtimes.com/separationandme', 'morgyken@gmail.com', '212646', 'This is the Vienna', '2018-08-25 06:45:27', '2018-08-25 06:45:27', NULL),
(10009, 'Mapping Any Location on Earth With Just Three Words\r\n07_08_GS3Words_01\r\nNewsweek Magazine\r\nBeyond Brexit: Europe’s Populist Backlash Against Immigration and Globalization\r\nBy Owen Matthews On 6/28/16 at 6:10 AM\r\n07_08_Brexit_01\r\nAn overwhelming', 'Mapping Any Location on Earth With Just Three Words\r\n07_08_GS3Words_01\r\nNewsweek Magazine\r\nBeyond Brexit: Europe’s Populist Backlash Against Immigration and Globalization\r\nBy Owen Matthews On 6/28/16 at 6:10 AM\r\n07_08_Brexit_01\r\nAn overwhelming 73 percent of voters aged 18 to 24 wanted to remain in the EU, while the majority of voters over 45 wanted to leave. Kevin Coombs/Reuters\r\nWorld\r\nBrexit\r\nEuropean Union\r\nBritain\r\n\r\nBritain’s Brexit vote was a victory of the old over the young, of the less educated over the educated, of nationalism over internationalism. No wonder the presumed U.S. Republican presidential nominee, Donald Trump—who happened to be visiting one of his golf courses in Scotland when the result was announced on June 24—was delighted. Polls show that both Brexit voters and Trump’s grassroots supporters are motivated by a similar mix of fear and fantasy: a yearning to control immigration, reverse globalization and restore national greatness by disengaging from the wide, threatening world.\r\n\r\n“People want to take their country back,” said Trump as news of the vote broke. “They want to have independence…all over Europe, they want to take their borders back.”\r\n\r\nTrump is right: The Brexit vote is just the latest and clearest manifestation of the populism and nativism that’s uniting the have-nots of Europe and America against the political establishment. The first victim of this political primal scream from the disenfranchised is likely to be the United Kingdom itself. In the wake of the Brexit vote, Scotland’s first minister, Nicola Sturgeon, announced that a new referendum on independence was “highly likely” after Scottish voters resoundingly backed remaining in Europe. Sturgeon said she would not stand for Scotland “being taken out of the EU against its will.” Northern Ireland’s deputy first minister, Martin McGuinness, called for a vote on reuniting with the Republic of Ireland, calling it “the next logical step', 'morgyken@gmail.com', '939086', 'Here is the topic', '2018-08-25 11:50:51', '2018-08-25 11:50:51', NULL),
(10010, 'The Root collection', 'The Root collection', 'morgyken@gmail.com', '699320', 'Topic is here', '2018-08-26 06:50:54', '2018-08-26 06:50:54', NULL),
(10011, 'Angleterre. En France, 41% des Front Nationals sont la seule cible du socialisme, avec 21%, et ils disent que c\'est le plus grand de France en France. En Espagne, 49% des donateurs et 42% des personnes du Par', 'Angleterre. En France, 41% des Front Nationals sont la seule cible du socialisme, avec 21%, et ils disent que c\'est le plus grand de France en France. En Espagne, 49% des donateurs et 42% des personnes du Parti socialiste des travailleurs espagnols, 19% de la cible, en raison de la formation peuvent, pour l\'audiovisuel espagnol est très important de naître en Espagne.\r\nL\'éducation joue également un rôle important dans les relations publiques entre la naissance et l\'identité. Dans 8 des 10 pays européens, ils sont plus importants que d’autres qui, selon eux, sont très importants dans leur pays. Les différences de formation étaient de 24 points au Royaume-Uni, 23 en Espagne et 19 en Pologne. À titre de comparaison, plus de la moitié des Américains pensent qu’il est très élevé (32%) et il est important (23%) qu’il soit né aux États-Unis. Il est presque identique à la moyenne européenne (33% plus élevé, 25% est important). Moins d’éducation dira probablement qu’il est très important de naître dans le pays. Pour naître dans notre pays, il est toutefois très important que les Blancs (études courtes du pays) étudient moins le Royaume-Uni, l’Espagne, la Pologne, la Grèce, la France, l’Allemagne, la Hollande, la Suède. Remarque: la seule exposition significative est différente. Pour le Groupe d’étude comparatif international, nous fondons nos normes éducatives sur la Classification internationale internationale de l’éducation (CITE) des Nations Unies. Dans tous les pays, à l\'exception de la Pologne, l\'enseignement primaire est supérieur ou supérieur. En Pologne, la catégorie de l\'enseignement primaire se situe au secondaire. Source: Enquête mondiale sur la pensée 2016. Q85a.', 'morgyken@gmail.com', '703606', 'Here is my Topic', '2018-08-26 17:35:42', '2018-08-26 17:35:42', NULL),
