;\r\n&lt;/div&gt;\r\n&lt;div class=&quot;g&quot;&gt;\r\n&lt;div data-hveid=&quot;CAkQAA&quot; data-ved=&quot;2ahUKEwiv86GciZjdAhVOYxoKHX8AAmQQFSgAMAF6BAgJEAA&quot;&gt;\r\n&lt;div class=&quot;rc&quot;&gt;\r\n&lt;h3 class=&quot;r&quot;&gt;&lt;a href=&quot;https://www.google.com/url?sa=t&amp;amp;rct=j&amp;amp;q=&amp;amp;esrc=s&amp;amp;source=web&amp;amp;cd=2&amp;amp;cad=rja&amp;amp;uact=8&amp;amp;ved=2ahUKEwiv86GciZjdAhVOYxoKHX8AAmQQFjABegQICRAB&amp;amp;url=https%3A%2F%2Fgithub.com%2Flaravel%2Fframework%2Fissues%2F9678&amp;amp;usg=AOvVaw1Uesdwjd6S3vpmGa0c4eVK&quot; data-cthref=&quot;/url?sa=t&amp;amp;rct=j&amp;amp;q=&amp;amp;esrc=s&amp;amp;source=web&amp;amp;cd=2&amp;amp;cad=rja&amp;amp;uact=8&amp;amp;ved=2ahUKEwiv86GciZjdAhVOYxoKHX8AAmQQFjABegQICRAB&amp;amp;url=https%3A%2F%2Fgithub.com%2Flaravel%2Fframework%2Fissues%2F9678&amp;amp;usg=AOvVaw1Uesdwjd6S3vpmGa0c4eVK&quot;&gt;[5.1] [5.2] Composer update issues &amp;middot; Issue #9678 &amp;middot; laravel/framework ...&lt;/a&gt;&lt;/h3&gt;\r\n&lt;div class=&quot;s&quot;&gt;\r\n&lt;div&gt;\r\n&lt;div class=&quot;f hJND5c TbwUpd&quot; style=&quot;white-space: nowrap;&quot;&gt;&lt;cite class=&quot;iUh30&quot;&gt;https://github.com/laravel/framework/issues/9678&lt;/cite&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;div class=&quot;g&quot;&gt;\r\n&lt;div data-hveid=&quot;CAkQAA&quot; data-ved=&quot;2ahUKEwiv86GciZjdAhVOYxoKHX8AAmQQFSgAMAF6BAgJEAA&quot;&gt;\r\n&lt;div class=&quot;rc&quot;&gt;\r\n&lt;div class=&quot;s&quot;&gt;\r\n&lt;div&gt;&lt;span class=&quot;st&quot;&gt;&lt;span class=&quot;f&quot;&gt;Jul 18, 2015 - &lt;/span&gt;Say you add a new service provider and try to deploy, current &lt;em&gt;Laravel&lt;/em&gt; will mess up when it comes to clear the compiled file. This has been&amp;nbsp;...&lt;/span&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;div class=&quot;g&quot;&gt;\r\n&lt;div data-hveid=&quot;CAgQAA&quot; data-ved