(10029, '\r\nRemixing a Classic\r\n', '&lt;div class=&quot;page-section__block g12-xs g9-md g6-xl&quot;&gt;\r\n&lt;h3 class=&quot;f5 cl-orange mb16&quot;&gt;Remixing a Classic&lt;/h3&gt;\r\n&lt;p class=&quot;f4 cl-white mv16&quot;&gt;So how did the classical Latin become so incoherent? According to McClintock, a 15th century typesetter likely scrambled part of Cicero\'s &lt;em&gt;De Finibus&lt;/em&gt; in order to provide placeholder text to mockup various fonts for a type specimen book.&lt;/p&gt;\r\n&lt;p class=&quot;f4 cl-white mv16&quot;&gt;It\'s difficult to find examples of &lt;em&gt;lorem ipsum&lt;/em&gt; in use before Letraset made it popular as a dummy text in the 1960s, although McClintock says he remembers coming across the &lt;em&gt;lorem ipsum&lt;/em&gt; passage in a book of old metal type samples. So far he hasn\'t relocated where he once saw the passage, but the popularity of Cicero in the 15th century supports the theory that the filler text has been used for centuries.&lt;/p&gt;\r\n&lt;p class=&quot;f4 cl-white mv16&quot;&gt;And anyways, as &lt;a title=&quot;Straight Dope &amp;ndash; What Does the Filler Text Lorem Ipsum Mean?&quot; href=&quot;https://www.straightdope.com/columns/read/2290/what-does-the-filler-text-lorem-ipsum-mean/&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Cecil Adams reasoned&lt;/a&gt;, &amp;ldquo;[Do you really] think graphic arts supply houses were hiring classics scholars in the 1960s?&amp;rdquo; Perhaps. But it seems reasonable to imagine that there was a version in use far before the age of Letraset.&lt;/p&gt;\r\n&lt;p class=&quot;f4 cl-white mv16&quot;&gt;McClintock &lt;a title=&quot;About Lorem Ipsum&quot; href=&quot;http://www.loremipsum.de/about_lorem_ipsum.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;wrote&lt;/a&gt; to &lt;em&gt;Before &amp;amp; After&lt;/em&gt; to explain his discovery;&lt;/p&gt;\r\n&lt;blockquote class=&quot;page-section__blockquote&quot;&gt;&amp;ldquo;What I find remarkable is that this text has been the industry\'s standard dummy text ever since some printer in the 1500s took a galley of type and scrambled it to make a type specimen book; it has survived not only four centuries of letter-by-letter resetting but even the leap into electronic typesetting, essentially unchanged except for an occasional \'ing\' or \'y\' thrown in. It\'s ironic that when the then-understood Latin was scrambled, it became as incomprehensible as Greek; the phrase \'it\'s Greek to me\' and \'&lt;a title=&quot;Wikipedia &amp;ndash; Greeking&quot; href=&quot;https://en.wikipedia.org/wiki/Greeking&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;greeking&lt;/a&gt;\' have common semantic roots!&amp;rdquo; (The editors published his letter in a correction headlined &amp;ldquo;Lorem Oopsum&amp;rdquo;).&lt;/blockquote&gt;\r\n&lt;p class=&quot;f4 cl-white mv16&quot;&gt;As an &lt;a title=&quot;Deep Advantage &amp;ndash; Lorem Ipsum&quot; href=&quot;https://www.deepadvantage.com/blog/lorem-ipsum/&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;alternative theory&lt;/a&gt;, (and because Latin scholars do this sort of thing) someone tracked down a 1914 Latin edition of &lt;em&gt;De Finibus&lt;/em&gt; which challenges McClintock\'s 15th century claims and suggests that the dawn of &lt;em&gt;lorem ipsum&lt;/em&gt; was as recent as the 20th century. The 1914 Loeb Classical Library Edition ran out of room on page 34 for the Latin phrase &amp;ldquo;dolorem ipsum&amp;rdquo; (sorrow in itself). Thus, the truncated phrase leaves one page dangling with &amp;ldquo;do-&amp;rdquo;, while another begins with the now ubiquitous &amp;ldquo;lorem ipsum&amp;rdquo;.&lt;/p&gt;\r\n&lt;p class=&quot;f4 cl-white mt16 mb0&quot;&gt;Whether a medieval typesetter chose to garble a well-known (but non-Biblical&amp;mdash;that would have been sacrilegious) text, or whether a quirk in the 1914 Loeb Edition inspired a graphic designer, it\'s admittedly an odd way for Cicero to sail into the 21st century.&lt;/p&gt;\r\n&lt;/div&gt;', 'morgyken@gmail.com', '734700', 'Remixing a Classic', '2018-09-02 17:59:09', '2018-09-02 17:59:09', NULL),
